import React from "react";
import Navbar from "./_components/Navbar";
import Hero from "./_components/Hero Section/Hero";

const LandingPage = () => {
  return (
    <div className="">
      <div>
        <Navbar />
      </div>
      <div className="-z-20">
        <Hero />
      </div>
    </div>
  );
};

export default LandingPage;
